using System;
using System.Collections.Generic;

namespace ConsoleEngine
{
    class Program
    {
        static List<char> CanInput = new List<char> { '1', '2', '3', '4', '5', '6', '7', '8', '9', '0', '-' };
        static void Main(string[] args)
        {
            ConsoleEngine.Run();

            ConsoleEngine.PrintLine("");

            string cmd = ConsoleEngine.ReadLine();

            while(cmd != "exit")
            {
                ConsoleEngine.PrintLine(cmd);
                cmd = ConsoleEngine.ReadLine();
            }
        }
    }
}
